import Link from "next/link";

const Landing = () => (
  <div className="landing">
    <section id="intro">
      <h1>W o o Y o u n g C h o i</h1>
      <p>
        <span>Designer</span> & <span>Front-end Developer</span> based in New
        York.
      </p>
    </section>
    <style jsx>
      {`
        .landing {
          align-items: center;
          display: flex;
          flex-direction: column;
          font-family: Futura;
          justify-content: center;
          min-height: 100vh;
          text-align: center;
        }

        h1 {
          font-family: "Futura";
